import React from "react";

export default function ReviewCard() {
    return (
        <div className="review-card">
            <div className="reviewer"><span className="reviewer-name">ROGER EBERT</span>, Chicago Times</div>
            <div className="review-content">
                "There Will Be Blood" is the kind of film that is easily called great. I am not sure of its greatness.
                It was filmed in the same area of Texas used by "No Country for Old Men," and that is a great film,
                and a perfect one. But "There Will Be Blood" is not perfect, and in its imperfections (its unbending
                characters, its lack of women or any reflection of ordinary society, its ending, its relentlessness)
                we may see its reach exceeding its grasp. Which is not a dishonorable thing.
            </div>
        </div>
    )
}
